import React from "react";
import { useAuth } from "../Hooks/useAuth";

const { userData } = useAuth();

const authData = {
  signedIn: userData.signedIn,
  user: userData.user
};

export default React.createContext({authData: {...authData}, setAuthData: (val) => {}});
